function getPoisHousing(){
    for (var i = 0; i < 45; i++) {
        var page = i + 1;
        request(`https://restapi.amap.com/v3/place/text?key=c7aeb11746b35a92b7b6eee3178a05e4&keywords=&types=120302&city=210100&children=1&offset=20&page=${page}&extensions=all`, function (error, response, body) {
            var obj = JSON.parse(body);
            var pois = obj.pois;
            var ids = "";
            console.log(pois);

            pois.forEach(function(poi){
                ids += `{"poiId":"${poi.id}","poiLocation":"${poi.location}","poiName":"${poi.name}","poiType":"${poi.type}","poiAddress":"${poi.address}","poiBounds":"null"},`;
            })
            fs.appendFile("./poisHousing.txt", ids, (error)=> {
                if (error) return console.log("追加文件失败" + error.message);
                console.log("追加成功");
            });
        });
    }


}




